pragma solidity ^0.4.24;

import './TradeBridgeCoin.sol';
import 'zeppelin-solidity/contracts/ownership/Ownable.sol';
import 'zeppelin-solidity/contracts/math/SafeMath.sol';
import "zeppelin-solidity/contracts/lifecycle/Pausable.sol";
import "zeppelin-solidity/contracts/token/ERC20/SafeERC20.sol";
import "zeppelin-solidity/contracts/token/ERC20/ERC20.sol";

contract TradeBridgeCoinSale is Ownable, Pausable {
  using SafeMath for uint256;
  using SafeERC20 for TradeBridgeCoin;

  //send tokens for the exchange of ethers, logged to trigger server action
  event Withdrawal(address indexed to, uint balance, uint value);
  //logger after withdrawals have been logged
  event Withdrawn(address indexed to, string reqTxHash, uint value);
  //send ethers for the exchange of tokens, logged to trigger server action
  event Deposit(address indexed from, uint indexed balance, uint value, bytes agent);
  //logger after deposits have been logged
  event Deposited(address indexed from, string reqTxHash, uint value);
  //send tokens(or nothing if value == 0) to request the server for something by defining data field, which is a JSON and to be parsed by the server
  event ActionMessage(address indexed from, uint value, uint8 category, string data/*json*/);
  //published to the ethereum by the server to confirm the ActionMessage or to post the effect of the ActionMessage
  event Action(string actionMsg, address indexed beneficiary, string data/*json*/);
  //notification from the owner to all holders
  event Notification(string message, uint256 publishedAt/*timestamp*/, uint256 validThru/*timestamp*/);
  //vote messages from all holders
  /*TODO DEBUG the vote method malfunction while wallet token is empty*/
  event Vote(address voter, uint8 category, string voteMsg/*json*/, uint256 tokenToVote, uint256 publishedAt/*timestamp*/);
  //query pricing for the bulk transaction
  event PriceQuery(address indexed by, int8 direction, uint value, string tTag);
  //response to pricing query for the bulk transaction
  event PriceResp(address indexed by, string query, int8 direction, uint value, uint price);
//  //internal transaction: tokens sent to beneficiary from wallet due to actions
//  event ActionTokenSentFromWallet(address to, uint value);
//  //internal transaction: Tokens mint and sent to beneficiary due to actions
//  event ActionTokenMint(address to, uint value);
//  //internal transaction: Tokens mint and sent to beneficiary due to actions
//  event ActionTokenStacked(uint value);
  //ERROR messages:
  event ErrorMsg(string origin, address indexed from, string msg);
  //transfer token between ordinary accounts
  event TokenTransferred(address indexed from, address indexed to, uint tokenAmount);
  //to make some previous events to ignore
  event IgnoreEvent(address indexed accToIgnore, string txHashToIgnore);

//  mapping (address => string) internal actionMap;
  mapping (string => uint) internal arguments;

  function () external payable {
      buyToken(msg.sender, msg.data);
    }

  // The token being sold
  TradeBridgeCoin public token;

  // Address where funds are collected
  address public wallet;

  // Amount of wei raised
  uint256 public weiRaised;

  // current price set by the owner for a small amount of deposit / wither; for the big amount, use queryPrice
//  uint currentPrice;

  function actionMessage(address actor, uint tokenValue, uint8 category, string data) whenNotPaused public {
    require(actor == msg.sender);
//    require(actor != address(0));
    require(bytes(data).length != 0);
    require(tokenValue >= 0);
    require(token.balanceOf(actor) >= tokenValue);

    emit ActionMessage(actor, tokenValue, category, data);
  }

  function actionConfirm(string actionMsg, address beneficiary, string data) public onlyOwner returns(bool){
    require(bytes(data).length != 0);

    emit Action(actionMsg, beneficiary, data);
    return true;
  }

  function withdraw(address beneficiary, uint value) whenNotPaused  public {
    require(beneficiary != address(0));
    require(beneficiary == msg.sender);
    require(token.balanceOf(beneficiary) >= value);
    require(value > 0);

    token.safeTransferFromTo(beneficiary, wallet, value);
    emit Withdrawal(beneficiary, token.balanceOf(beneficiary), value);

  }

  function sendToken(string actionMsg, address beneficiary, uint value, string data) public onlyOwner returns(bool) {
    require(beneficiary != address(0));
    require(value > 0);

    uint256 deficit = 0;
    if(value > token.balanceOf(wallet))
      deficit = value.sub(token.balanceOf(wallet));

    if(value > deficit)
      token.safeTransferFromTo(wallet, beneficiary, value.sub(deficit));
//        emit ActionTokenSentFromWallet(beneficiary, value);
    bool go = false;
    if(deficit > 0){
      go = transferMintToken(beneficiary, deficit);
//          if(go)
//            emit ActionTokenMint(beneficiary, deficit);
    } else {
      go = true;
    }
    if(go && bytes(data).length > 0)
      emit Action(actionMsg, beneficiary, data);
//          actionMap[beneficiary] = data; //orderMap[beneficiary].toSlice().concat(data.toSlice()).toSlice().concat("|".toSlice());
    return go;
  }

  function stackToken(string actionMsg, address from, uint value, string data) public onlyOwner returns(bool) {
    require(value > 0);
//    require(token.balanceOf(from) >= value);

    if(token.balanceOf(from) >= value){
      token.safeTransferFromTo(from, wallet, value);
      if(bytes(data).length > 0)
        emit Action(actionMsg, from, data);
      //          actionMap[from] = data; //orderMap[from].toSlice().concat(data.toSlice()).toSlice().concat("|".toSlice());
      //        emit ActionTokenStacked(value);
      return true;
    }else{
      emit ErrorMsg(actionMsg, from, "token balance is lower than the value to invest");
      return false;
    }
  }

  function logWithdrawn(address to, string reqTxHash, uint value) public onlyOwner returns(bool) {
    require(value > 0);
    require(bytes(reqTxHash).length > 0);

    emit Withdrawn(to, reqTxHash, value);
    return true;
  }

  function logDeposited(address to, string reqTxHash, uint value) public onlyOwner returns(bool) {
    require(value > 0);
    require(bytes(reqTxHash).length > 0);

    emit Deposited(to, reqTxHash, value);
    return true;
  }

  function buyToken(address beneficiary, bytes agent)  public  whenNotPaused payable {
    require(beneficiary != address(0));
    require(msg.value > 0);

    //TODO move the transfer to the wallet to server side to make the transfer method by the clients using transfer() available, which fails when gas goes above 2300, only enough to log an event
//    uint256 weiAmount = msg.value;
    weiRaised = weiRaised.add(msg.value);
    wallet.transfer(msg.value);
    emit Deposit(msg.sender, weiRaised, msg.value, agent);
  }

  function broadcastNotification(string message, uint256 validThru) public onlyOwner{
//    require(msg.sender != address(0));
    require(bytes(message).length != 0);

    emit Notification(message, block.timestamp.mul(1000), validThru);
  }

  function priceQuery(address by, int8 direction, uint value, string tag)  public whenNotPaused returns(bool){
    require(value > 0);
    require(by == msg.sender);

    if(direction == -1){
      if(token.balanceOf(by) >= value){
        emit PriceQuery(by, direction, value, tag);
        return true;
      }else
        revert();
    }else if(direction == 1){
      emit PriceQuery(by, direction, value, tag);
      return true;
    }else{
      revert();
      return false;
    }
  }

  function priceResp(address by, string query, int8 direction, uint value, uint price) public onlyOwner returns(bool){
    emit PriceResp(by, query, direction, value, price);
    return true;
  }

  constructor(address _wallet, TradeBridgeCoin _token) public {
    require(_wallet != address(0));
    require(_token != address(0));

    wallet = _wallet;
    token = _token;
  }

  function transferMintToken(address beneficiary, uint256 tokenAmount) public onlyOwner returns(bool){
    require(tokenAmount > 0);
//    require(tokenAmount < 100000000000000);
    return token.mint(beneficiary, tokenAmount);
  }

  function depositTokens(address beneficiary, uint256 tokenAmount, string reqTxHash) public onlyOwner returns(bool){
    require(beneficiary != address(0));
    require(tokenAmount > 0);
//    require(tokenAmount < 100000000000000);
    require(bytes(reqTxHash).length > 0);

    bool go = transferMintToken(beneficiary, tokenAmount);
    if(go){
        emit Deposited(beneficiary, reqTxHash, tokenAmount);
        return true;
    }else{
        return false;
    }
  }

  function transfer(address beneficiary, uint256 tokenAmount) public  whenNotPaused returns(bool) {
    require(msg.sender != address(0));
    require(beneficiary != address(0));
    require(tokenAmount <= token.balanceOf(msg.sender));
    require(tokenAmount > 0);

    token.safeTransferFromTo(msg.sender, beneficiary, tokenAmount);
    emit TokenTransferred(msg.sender, beneficiary, tokenAmount);
    return true;

  }

  function logIgnoreEvent(address accToIgnore, string txHashToIgnore) public onlyOwner returns(bool) {
    require(accToIgnore != address(0));
    require(bytes(txHashToIgnore).length > 0);

    emit IgnoreEvent(accToIgnore, txHashToIgnore);
    return true;
  }

//  function getActionMapData(address key) public onlyOwner constant returns(string) {
//    return actionMap[key]; //"data:".toSlice().concat(orderMap[key].toSlice());
//  }
//
//  function getActionData() public constant returns(string) {
//    require(msg.sender != address(0));
//
//    return actionMap[msg.sender]; //"data:".toSlice().concat(orderMap[key].toSlice());
//  }

//  function setVoteThreshold(uint _value) public onlyOwner returns(uint) {
//    voteThreshold = _value;
//    return voteThreshold;
//  }
//
//  function getVoteThreshold() public constant returns(uint) {
//    return voteThreshold;
//  }
//
//  function setCurrentPrice(uint _value) public onlyOwner returns(uint) {
//    currentPrice = _value;
//    return currentPrice;
//  }
//
//  function getCurrentPrice() public constant returns(uint) {
//    return currentPrice;
//  }

  function getTokenBalance(address _account) public constant returns(uint) {
    require(msg.sender == _account || msg.sender == owner);

    return token.balanceOf(_account);
  }

  function getArguments(string _key) public constant returns(uint) {
    return arguments[_key];
  }

  function setArguments(string _key, uint _value) public onlyOwner returns(bool) {
    require(bytes(_key).length > 0);

    arguments[_key] = _value;
    return true;
  }

  function setErrorMsg(string origin, address from, string message) public onlyOwner returns(bool) {
//    require(bytes(message).length > 0);
    emit ErrorMsg(origin, from, message);

    return true;
  }

  function setPause(bool toPause, uint256 timestamp, string message) public onlyOwner {
    if(toPause){
      pause(timestamp, message);
    }else{
      unpause(timestamp, message);
    }
  }

}
